// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract Buyer {

    address public  owner;

    constructor() payable {

        require(msg.value >= 5 ether, "Must Be Deployed With 5 Ether");
        owner = msg.sender;
    }


    function getOwnership(address sellerContract, address _seller) external payable{
        require(msg.sender == owner ,"Cannot Called By You");
        (bool got,) = sellerContract.call(abi.encodeWithSignature("transferOwnership(address)",owner));
        require(got, "failed to GetOWnerShip");
        (bool paid,) = payable (_seller).call{value:address(this).balance}("");
        require(paid, "failed to Paid");
    }
}

